import React from 'react';


const Home = () => {
  return (
    <div className="home-container">
      <div className="text-container">
        <h1>Welcome to Our Organization</h1>
        <p>This is a brief introduction to our organization. We are dedicated to making the world a better place through our various initiatives and programs.</p>
      </div>
      <div className="image-container">
        <img src="./pictures/suits.png" alt="Organization" />
      </div>
    </div>
  );
};

export default Home;
